11	Калибровка ПВД	\n*Инструкция по калибровке ПВД*\n\n🚨 *Перед началом калибровки ПВД убедитесь, что устройство подключено и работает корректно!*\n\nДля калибровки необходимо поменять ряд параметров, для этого:\n\n1️⃣ *Перейдите в раздел «CONFIG»*.\n2️⃣ *Перейдите в раздел «Full Parameter List»*.\n3️⃣ *В левом списке заголовков параметров найдите раздел «ARSPD»*.\n4️⃣ Для параметра *«ARSPD_AUTOCAL»* в столбце «Value» установите значение *1*.\n5️⃣ Для параметра *«ARSPD_USE»* в столбце «Value» установите значение *0*.\n6️⃣ В правой части экрана нажмите на кнопку *«Write Params»*, чтобы записать изменения.\n7️⃣ Запустите самолет на калибровку ПВД.\n\n💡 *Для обычного ПВД диапазон корректных значений для параметра «ARSPD_RATIO» составляет от 1.5 до 1.7!*\n\n❗️ *Если калибровка не дала изменений параметра «ARSPD_RATIO», вы можете установить его значение вручную, равное *1.6*.*\n\n⚠️ *После калибровки ПВД не забудьте вернуть параметры на прежние значения:*  \n- для *«ARSPD_AUTOCAL»* установите значение *0*  \n- для *«ARSPD_USE»* установите значение *1*!!!\n\n*Важно!* После калибровки и корректировки значений всегда проверяйте параметры перед использованием в реальных условиях полета.\n\n		30	0	0	0	2025-06-01 17:35:20.717+03	28	2	setupInstructions	\N
