17	Бесконечная калибровка	\n📛 **Ошибка: Бесконечная калибровка компаса**\n\n🛠️ *Описание:*  \nЕсли зелёная полоса прогресса при калибровке компаса постоянно сбрасывается, это говорит о наличии ошибок при калибровке.\n\n🔍 *Что проверить в первую очередь:*\n\n1️⃣ Убедитесь, что компас подключён и корректно определяется системой.  \n2️⃣ Проверьте, что компас прочно закреплён и не болтается внутри фюзеляжа.\n\n⚙️ *Дополнительные шаги для устранения ошибки:*\n\n3️⃣ Перейдите в *«CONFIG»* → *«Full Parameter List»*.  \n4️⃣ Найдите раздел параметров *«COMPASS»*.  \n5️⃣ Установите параметр *«COMPASS_CAL_FIT»* на *32*.  \n6️⃣ Установите параметр *«COMPASS_OFFS_MAX»* на *3000*.  \n7️⃣ Нажмите *«Write Params»* для записи параметров.  \n8️⃣ Повторите попытку калибровки.\n\n🔁 *После успешной калибровки:*  \n— Верните *«COMPASS_CAL_FIT»* на *16*  \n— Верните *«COMPASS_OFFS_MAX»* на *1800*\n\n📡 *Если проблема остаётся:*  \n*Попробуйте отключить антенну GPS во время калибровки*. Убедитесь, что рядом нет:  \n— Металлоконструкций  \n— Источников электромагнитного излучения  \n— Магнитных аномалий\n\n❗ *Если ничего не помогает:*  \nЗамените компас на заведомо рабочий.\n\n		42	0	0	0	2025-06-01 17:35:20.717+03	28	9	preArmError	\N
12	Настроки обычного ПВД	\nИнструкция по подключению обычного ПВД:\n\n1. Перейдите в «CONFIG» > «Full Parameter List».\n2. Найдите раздел «ARSPD» в списке параметров.\n3. Установите параметр «ARSPD_BUS» на 1.\n4. Установите параметр «ARSPD_TYPE» на 8.\n5. Нажмите на кнопку «Write Params» для сохранения изменений.\n6. Перейдите в раздел «Setup».\n7. Раскройте слева пункт «Optional Hardware».\n8. Перейдите в раздел «Airspeed».\n9. ✅ Убедитесь, что для значения «Use Airspeed» стоит галочка.\n10. ✅ Убедитесь, что в значении «Pin установлено значение «Pixhawk Analog» as Port.\n11. ⚡ Обесточьте борт и запустите его снова.\n12. 🔍 Проверьте, что ПВД корректно подключен и работает.\n\nПосле подключения и настройки ПВД убедитесь, что данные отображаются корректно, и ПВД функционирует должным образом.\n\n\n		31	0	0	0	2025-06-01 17:35:20.717+03	28	2	setupInstructions	\N
