18	Калибровка 33%	\n📛 **Ошибка: Калибровка компаса до 33%**\n\n🛠️ *Описание:*  \nЕсли калибровка компаса останавливается на уровне 33% и не продолжается — это признак неисправного компаса.\n\n🔧 *Что делать:*\n\n1️⃣ Замените компас на новый.  \n2️⃣ После установки нового компаса обязательно проведите его калибровку.\n\n📍 *Если новый компас не определяется:*\n\n3️⃣ Перейдите в раздел *«SETUP»*.  \n4️⃣ Перейдите в подраздел *«Compass»*.  \n5️⃣ Нажмите кнопку *«Remove Missing»*.  \n6️⃣ Закройте Mission Planner.  \n7️⃣ Запустите Mission Planner.  \n8️⃣ Проверьте, что компас определяется, установлена галочка *«External»*.  \n9️⃣ Поднимите новый компас на первое место в списке.  \n🔟 Проведите калибровку.\n\n✅ После этих действий компас должен быть определён и успешно откалиброван.\n\n		43	0	0	0	2025-06-01 17:35:20.717+03	28	9	preArmError	\N
