4	Подключение двух НСУ к одному самолету	\n📡 **Подключение двух НСУ к одному самолету**  \n\n⚠️ **ВНИМАНИЕ:** НЕ МЕНЯЙТЕ НАСТРОЙКИ, В КОТОРЫХ НЕ УВЕРЕНЫ!!!  \n⚠️ **ВНИМАНИЕ:** СНАЧАЛА МЕНЯЙТЕ НАСТРОЙКИ НА ВОЗДУШНОМ МОДУЛЕ, А ПОТОМ НА НАЗЕМНЫХ!!!  \n\nДля данной процедуры понадобятся **минимум два наземных модуля связи Mesh**, а также **самолет на связи Mesh**.  \n❗ *Все модули связи должны работать на одной частоте!*  \n\n### **🔧 Инструкция по подключению:**  \n1. Установить **идентичные настройки** на всех модулях связи, чтобы они появились в одной сети.  \n2. На каждом модуле связи перейти в **раздел "Multicast"** и включить параметр **"IGMP (Enable: Update All Nodes)"** (*установить статус "Enable"*)  \n3. Перейти на **воздушный модуль** в раздел **"Serial"**  \n4. Установить IP в параметре **"Serial0"** на **192.168.1.255**  \n5. На **воздушном модуле** перейти в раздел **"Broadcast"**  \n6. Для параметра **"Broadcast ip data (udp) whitelist list"**:  \n   🔹 **Port** = 1024  \n   🔹 **Priority** = High  \n7. Сохранить настройки  \n8. Перейти на **наземный модем связи первой НСУ**  \n9. Перейти на **наземный модуль** в раздел **"Serial"**  \n10. Установить IP в параметре **"Serial0"** на **192.168.1.105**  \n11. Для данной НСУ установить в **Ethernet** значение IP **192.168.1.105**  \n12. Перейти на **наземный модем связи второй НСУ**  \n13. Перейти на **наземный модуль** в раздел **"Serial"**  \n14.  Установить IP в параметре **"Serial0"** на **192.168.1.106**  \n15. Для данной НСУ установить в **Ethernet** значение IP **192.168.1.106**  \n16. ✅ **Наслаждаться проделанной работой!**  \n\n🎥 *Если возникли проблемы — посмотрите видео ниже. Если оно не помогло, обратитесь к знающему человеку.*  \n\n⚠️ **Важно!** При такой настройке **активным может быть только один джойстик**!  \nБудьте аккуратны при перехвате управления — проверьте **все тумблеры** на джойстике!\n		11	16	3	0	2025-06-01 17:35:20.717+03	28	3	setupInstructions	
