3	Дальномер H-flow	*Инструкция по подключению дальномера на 30 метров H-FLOW.*\r\n\r\nПодключите H-FLOW к порту CAN\r\n\r\n1. Подключитесь к Mission Planner\r\n2. Подключитесь к борту\r\n3. Перейдите в раздел *"Full parameter list"*\r\n4. Задайте следующие параметры:\r\n    - *FLOW_TYPE* = 6 (DroneCAN)\r\n    - *CAN_P1_DRIVER* = 1 \r\n    - *CAN_D1_PROTOCOL* = 1 \r\n    - *RNGFND1_TYPE* = 24\r\n    - *RNGFND1_MAX_CM* = 3000 (максимальная дальность 30 м)\r\n    - *EK3_SRC_OPTIONS* = 0 (отключить *FuseALLVelocities*)\r\n    - *EK3_FLOW_DELAY* (по умолчанию)\r\n    - *EK3_SRC1_POSXY* = 0 (использовать оптический поток)\r\n    - *EK3_SRC1_VELXY* = 5\r\n    - *EK3_SRC1_POSZ* = 1\r\n    - *EK3_SRC1_VELZ* = 0\r\n    - *EK3_SRC1_YAW* = 1\r\n    - *FLOW_POS_X*, *FLOW_POS_Y*, *FLOW_POS_Z* (смещение положения H-FLOW в зависимости от монтажного положения)\r\n5. Перезагрузите борт.\r\n\r\n*Важно:* Убедитесь, что все параметры заданы правильно перед перезагрузкой.	photo_2025-03-30_23-01-03.jpg, photo_2025-02-13_16-47-23.jpg		182	8	2	2025-06-07 20:58:20.717+03	28	1	setupInstructions	logos/photo_2025-03-30_23-01-03.jpg
