371	FS_GCS_ENABL	Этот параметр включает или отключает систему аварийной блокировки при потере связи с наземной станцией (gcs). аварийная блокировка будет активирована после того, как пройдет время, установленное в fs_long_timeout, если не поступят сообщения mavlink heartbeat. существует три возможных значения для этой настройки. если установить fs_gcs_enabl в 1, то аварийная блокировка будет срабатывать, когда аппарат не получит сообщения mavlink heartbeat от наземной станции. если установить fs_gcs_enabl в 2, то аварийная блокировка будет срабатывать как при потере heartbeat сообщений, так и при потере сообщений radio_status от радиопередатчика 3dr, что указывает на отсутствие связи между наземной станцией и аппаратом, что можно определить по нулевому значению поля radio_status.remrssi (это может произойти, если связь однонаправленная из-за шума на канале связи между наземной станцией и аппаратом). установка fs_gcs_enabl в 3 активирует блокировку только в режиме auto при потере heartbeat сообщений, как в первом варианте, но только в автоматическом режиме. внимание: включение этой опции может привести к тому, что самолет перейдет в аварийный режим и начнет работать двигатель на земле, если потеряет связь с наземной станцией. если эта опция включена для электрического самолета, следует также включить параметр arming_required для предотвращения запуска двигателя без разрешения. (секунды — это единица измерения времени, где 1 секунда — это одна единица времени, которая соответствует одной тысяче миллисекунд).	\N	\N	0	0	0	2025-08-12 23:07:40.808912+03	\N	85	ArdupilotParam	
